import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import {BroweserRouter} from 'react-router-dom'
ReactDOM.render(
  <React.StrictMode>
    <BroweserRouter></BroweserRouter>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
